"""
É possível a gente criar os seguintes objetos:
    - Seta (arrow)     # arrow()
    - Cubo (box)       # box()
    - Esfera (sphere)  # sphere()
    - Cone (cone)
    - Cilindro (cylinder)
    - Elipsoide (ellipsoid)
    - Hélice (helix)
    - Piramide (pyramid)
    - Anel (ring)

Os atributos (parametros) que podemos adicionar a cada um desses objetos são:
    - pos (position): posiciona o objeto no espaço 3D da cena. Recebe um vetor (x, y, z). Tem como default (0, 0, 0)
    - axis: parametro que posiciona o objeto no espaço 3D. Posiciona o 'fim' do objeto. (disponivel apenas para objetos
que podemos considerar que existe um começo e fim, como seta, cilindro, helice). Default = vector(0, 0, 0)

    - lenght: Altera o comprimento do objeto.

    - radius: Disponível para objetos que possuem um raio.

    - size: Parametro que recebe um vetor size=vector(lenght, height, width).

    - color*: Também recebe um vetor que em cada componente é fornecida a densidade de cor vermelha, verde e azul,
red-green-blue (RGB).
            vermelho (puro): vector(1, 0, 0)
            branco: vector(1, 1, 1)

            color=vector(1, 1, 1)  # Colocando a cor branca no objeto
            color=color.(nome da cor)
            color=color.white

vec(1,0,0) color.red	            vec(1,1,0) color.yellow	        vec(0,0,0) color.black
vec (0,1,0) color.green	            vec(1,0.6,0) color.orange	    vec(1,1,1) color.white
vec(0,0,1) color.blue	            vec(0,1,1) color.cyan
vec(0.4,0.2,0.6) color.purple	    vec(1,0,1) color.magenta

from vpython import*

box(color=vector(0.561, 0.831, 0.823))

    - opacity: Opacidade do objeto, default=1, 0 é completamente transparente.

    - shininess: Brilho do objeto 0 até 1, default=0.6

    - emissive: Se True, outras luzes da cena são ignoradas pelo objeto, este continua com a mesma cor. Default=False

    - texture: Textura no objeto. É possivel colocar uma textura nos objetos fazendo com que tenham a aparencia de
pedra, madeira, tecido, entre outras coisas. É possivel colocar uma textura 'importada' diretamente do computador,
ou da internet.

textures.flower, textures.granite, textures.gravel (cascalho), textures.metal, textures.rock, textures.rough,
textures.rug (carpete), textures.stones, textures.stucco (reboco), textures.wood, textures.wood_old, textures.earth

    - canvas: Por padrão, um objeto aparece na cena mais recente criada, mas podemos nomear as cenas e dizer em qual
delas um determinado objeto deve aparecer.

    - make_trail: Se True, ao movimentar um objeto em cena, é deixado um rastro mostrando por onde o objeto passou.
Existem alguns outros parametros que interferem no rastro deixado na cena.
            trail_type='curve' (default), podemos por também 'points'
            interval=int  # o rastro é atualizado depois de n interações.
            retain=int    # o rastro começa a ser apagado depois de n interações
            trail_color=color.(nome da cor)  # altera a cor do rastro
            clear.trail()  # apaga o rastro inteiro


"""

